import React from "react";
import "./Header.css";
import Slika from "./slike/Logo.jpg"



function Header(){
    return(
        <div className="header">
            
            <img className="logo" src={Slika} alt=""/>
            <input type="text" placeholder="Where are you headed?"></input>
            <button>LOGIN</button>
            
        </div>
    )
}

export default Header;
